import React from "react";
import background from "../Assets/IMG/volvo.jpg";
import {
  FormAutoComponent,
  FormUsuarioComponent,
  TableAutoComponent,
  TableUsuarioComponent,
  ButtonComponents,
} from "../components";

const HomePage = () => {
  return (
    <div style={{ backgroundImage: `url(${background})` }}>
      <div>
        <FormAutoComponent />
        <br />
        <FormUsuarioComponent />
        <br />
        <TableAutoComponent />
        <ButtonComponents />
        <br />
        <TableUsuarioComponent />
        <ButtonComponents />
        <br />
      </div>
    </div>
  );
};
export default HomePage;
